export const raw = 'data:image/png;base64,'
export const base64 = base64ToBlob(raw)
function base64ToBlob(base64: string, mimeType = 'image/png') {
  // Remove the prefix if it exists: "data:image/png;base64,..."
  const base64Data = base64.split(',')[1] ?? base64;

  // Decode Base64 to raw binary string
  const binaryString = atob(base64Data);

  // Create a Uint8Array from the binary string
  const len = binaryString.length;
  const bytes = new Uint8Array(len);
  for (let i = 0; i < len; i++) {
    bytes[i] = binaryString.charCodeAt(i);
  }

  // Create the Blob
  return new Blob([bytes], { type: mimeType });
}